          "description": "The Internet of things (IoT) describes the network of physical objectsa.k.a. thingsthat are embedded with sensors, software, and other technologies to connect and exchange data with other devices and systems over the Internet. As a technological solution, IoT uses a variety of different hardware technologies, e.g. accelerometers, temperature sensors, magnetometers, proximity sensors, gyroscopes, image sensors, etc. An improvement in any of these technologies might propel IoT to the next level."
