          "description": "Meta-learning is a subfield of machine learning where automatic learning algorithms are applied to metadata about machine learning experiments. The main goal is to use such metadata to understand how automatic learning can become flexible in solving learning problems, hence improving the performance of existing learning algorithms or to learn (induce) the learning algorithm itself, hence the alternative term learning to learn."
