          "description": "An index fund is a type of mutual fund or exchange-traded fund (ETF) with a portfolio constructed to match or track the components of a financial market index. Therefore, Longevity index funds are funds with an investment portfolio that comprises longevity-related securities. Longevity derivative is a type of financial instrument related to some type of longevity index or another longevity-related measurement."
